import React from "react";
import NoteForm from './NoteForm';

const Newnote = ({onCreateNote, onAddTag, tags})=>{
    return(
        <div>
            <h1>
            New note
            </h1>
            <NoteForm onCreateNote={onCreateNote} onAddTag={onAddTag} tags={tags}/>
        </div>
    )
}

export default Newnote;
